y (combined page gallery).<br>FIXED: Logo size on simple and focused checkout style.</p><p>ENHANCEMENT: Prevent hotspot opening quick view in builder.</p>\";}i:4;O:8:\"stdClass\":7:{s:2:\"id\";i:88770;s:9:\"timestamp\";i:1639677602;s:4:\"date\";s:12:\"Dec 16, 2021\";s:7:\"version\";s:6:\"3.15.0\";s:11:\"versionType\";s:5:\"minor\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:15;s:5:\"patch\";i:0;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:2658:\"<p>--- 3.15 (16.12.21) ---NEW: Core JavaScript file is now only 56kb (16kb gzipped).NEW: WooCommerce 6.0 compatibility.NEW: Header vertical menu element.NEW: Shape dividers (SVG graphic shapes).NEW: Improved JS performance (lazy load reduced core modules).NEW: Header vertical menu enable/disable icon option.NEW: Header vertical menu height &amp; width.NEW: Header vertical menu tagline &amp; text options.NEW: Header vertical menu color &amp; bg color options.NEW: Header vertical menu fly-out keep open option.NEW: Header vertical menu fly-out shadow option.NEW: Header vertical menu fly-out color &amp; bg color options.NEW: Custom logo link option.NEW: Sidebar top content option.NEW: Sidebar tabs option.NEW: Sidebar tabs text option.NEW: Builder: Open tabs on hover option.NEW: Builder: Shape divider color.NEW: Builder: Shape divider height &amp; width.NEW: Builder: Shape divider flip option.NEW: Builder: Shape divider to-front option.NEW: Paysera and Revolut payment icon.<br>ENHANCEMENT: Added layout ID and scope classes to custom product page wrapper.ENHANCEMENT: Set correct alpha for header background color.ENHANCEMENT: Checkmark swatches in widget items on hover.ENHANCEMENT: Builder: Hardened security.ENHANCEMENT: Various CSS improvements.<br>FIXED: Builder: Render empty paragraphs.FIXED: Builder: Initial value for conditional options.FIXED: Open UX Builder correctly on wordpress.com.FIXED: Set correct site logo width and height attributes.FIXED: Navigation dropdown display under active menu item.FIXED: Products: Ensure visibility for custom ID\'s on other styles than the default.FIXED: Builder: Custom product reviews selection and sorting in hierarchy panel when empty.FIXED: Container and full-width dropdown position on the very last menu item on the right.FIXED: Sticky add to cart is now default disabled on composite product types.FIXED: Container width dropdown when the main header is hidden when sticky.FIXED: WooCommerce account page before and after navigation hooks.FIXED: Terms and conditions lightbox content formatting.FIXED: Customizer color picker palette styling in RTL.FIXED: Products: PHP notice on an non existing tag.FIXED: Various CSS improvements.<br>DEV: Added woocommerce_gallery_image_html_attachment_image_params filter.DEV: Added flatsome_show_block_edit_tooltip filter.DEV: Added flatsome_swatches_box_attribute filter.DEV: Added flatsome_before_sidebar_menu action.DEV: Added flatsome_before_sidebar_menu_elements action.DEV: Added flatsome_after_sidebar_menu_elements action.DEV: Added flatsome_after_sidebar_menu action.DEV: Updated Angular.<br>Note: Minimum required WooCommerce version 4.4.0.</p>\";}i:5;O:8:\"stdClass\":7:{s:2:\"id\";i:86621;s:9:\"timestamp\";i:1631097258;s:4:\"date\";s:12:\"Sep 08, 2021\";s:7:\"version\";s:6:\"3.14.3\";s:11:\"versionType\";s:5:\"patch\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:14;s:5:\"patch\";i:3;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:750:\"<p>--- 3.14.3 ---<br>NEW: HTML element in UX Builder.</p><p>FIXED: Builder: Render paragraphs correctly for classic editor content.<br>FIXED: Thank you page content option didn\'t render shortcodes.<br>FIXED: Scroll to on mobile navigated incorrectly in some cases.<br>FIXED: Infinite scroll on masonry catalog layout.</p><p>ENHANCEMENT: Improved swatch compatibility for multiple woocommerce extension plugins.<br>ENHANCEMENT: Builder: Check post existence before going into edit mode.<br>ENHANCEMENT: Shop sticky sidebar height when infinite scroll items are appended.<br>ENHANCEMENT: Improved WPML configuration.</p><p>REVERT: Builder does not wrap text element content with paragraph anymore. (Use the new HTML element for raw content instead)</p>\";}i:6;O:8:\"stdClass\":7:{s:2:\"id\";i:85354;s:9:\"timestamp\";i:1626951795;s:4:\"date\";s:12:\"Jul 22, 2021\";s:7:\"version\";s:6:\"3.14.2\";s:11:\"versionType\";s:5:\"patch\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:14;s:5:\"patch\";i:2;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:308:\"<p>--- 3.14.2 --- (22.07.21)<br>FIXED: Product categories element displayed sub categories.FIXED: PHP notice product categories variable may not support offset operations.FIXED: PHP error on a new product previewed in draft mode.FIXED: Swatches admin image preview sizing.FIXED: Various CSS improvements.</p>\";}i:7;O:8:\"stdClass\":7:{s:2:\"id\";i:85065;s:9:\"timestamp\";i:1626284292;s:4:\"date\";s:12:\"Jul 14, 2021\";s:7:\"version\";s:6:\"3.14.1\";s:11:\"versionType\";s:5:\"patch\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:14;s:5:\"patch\";i:1;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:203:\"<p>--- 3.14.1 ---<br>FIXED: PHP issue with http_headers_useragent pre WP 5.1 3th party filter usage.<br>FIXED: Swatches incorrectly disabled in some cases.</p><p>ENHANCEMENT: Improved swatch caching.</p>\";}i:8;O:8:\"stdClass\":7:{s:2:\"id\";i:85011;s:9:\"timestamp\";i:1626172041;s:4:\"date\";s:12:\"Jul 13, 2021\";s:7:\"version\";s:6:\"3.14.0\";s:11:\"versionType\";s:5:\"minor\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:14;s:5:\"patch\";i:0;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:4454:\"<p>--- 3.14 ---<br>NEW: Product variation swatches.<br>NEW: UX Themes License manager.<br>NEW: WordPress 5.8 compatibility.<br>NEW: WooCommerce 5.5 compatibility.<br>NEW: Live search latency option.<br>NEW: Automatic New badge for products newer then x days.<br>NEW: Automatic New badge color option.<br>NEW: Infinitive option for all slide style elements.<br>NEW: Accordion collapsed product tab style.<br>NEW: Custom product stacked gallery style.<br>NEW: Builder: Sticky column option.<br>NEW: Swatches/attribute: Types (color, image, label).<br>NEW: Swatches/attribute: Size options.<br>NEW: Swatches/attribute: Shape options.<br>NEW: Swatches/attribute: Use variation image.<br>NEW: Swatches/product: Layout options.<br>NEW: Swatches/product: Tooltip option.<br>NEW: Swatches/product: Color selected option.<br>NEW: Swatches/shop: Show attribute variant swatches.<br>NEW: Swatches/shop: Layout options.<br>NEW: Swatches/shop: Size options.<br>NEW: Swatches/shop: Shape options.<br>NEW: Swatches/shop: Select event option (desktop).<br>NEW: Swatches/shop: Color selected option.<br>NEW: Swatches/shop: Selected swatch behavior option.<br>NEW: Swatches/shop: Update urls option.<br>NEW: Swatches/shop: Auto reset selection options.<br>NEW: Register: Lightbox panel layout options (left/right).<br>NEW: Register: Lightbox side panel custom UX Block.<br>NEW: Register: Lightbox side panel bg color option.<br>NEW: Register: Lightbox side panel bg image option.<br>NEW: Register: Lightbox side panel bg overlay option.<br>NEW: Google font-display \'auto\' option.<br>NEW: Telegram share/follow icon.<br>NEW: Twitch follow icon.<br>NEW: Discord follow icon.<br>NEW: Updated Google Fonts list.</p><p>ENHANCEMENT: Auto open mini cart refactored to work on all add to cart buttons.<br>ENHANCEMENT: Improved accordion item toggle arrow position when opened.<br>ENHANCEMENT: Sale label and percentage formatting options can now contain HTML.<br>ENHANCEMENT: Improved variation summarize details in mini cart, cart and checkout.<br>ENHANCEMENT: Portfolio: Distinguish tag and category names from WordPress once.<br>ENHANCEMENT: Builder: Text font and line option with smaller increments.<br>ENHANCEMENT: Builder: Custom product element thumbnails.<br>ENHANCEMENT: Improved accessibility on various elements.<br>ENHANCEMENT: Flatsome icon font versioning.<br>ENHANCEMENT: Optimized content processing.<br>ENHANCEMENT: Improved CLS on sliders.</p><p>FIXED: Possible undefined variable in tabs element.<br>FIXED: Placement of wp_footer output on maintenance template.<br>FIXED: Accordion: Slider incorrect rendered in some cases.<br>FIXED: Body was scrollable when lightbox or off-canvas was opened.<br>FIXED: Single product review link did not navigate on accordion tab style.<br>FIXED: Custom product gallery style could not be chosen if global template was stacked gallery.<br>FIXED: Custom sale label text was not used as fallback with percentage option enabled.<br>FIXED: WooCommerce Setup Wizard button link displayed at the end of the Flatsome Setup Wizard.<br>FIXED: Wishlist button now only gets \'added\' class to items that are actually in the wishlist.<br>FIXED: Shop filter not available on mobile search results page with custom Shop Page Content.<br>FIXED: Portfolio: Filter problem with the categories that may contain the same string.<br>FIXED: Product categories element did not show cats on PHP 8 if no Ids specified.<br>FIXED: Portfolio: Thumbnails missing on portfolio admin thumbnail column.<br>FIXED: UX Block edit link displayed on a deleted block reference.<br>FIXED: Maps: Incorrect height value in mobile devices.<br>FIXED: Slider: Missing closing bracket of embedded css.<br>FIXED: Menu item options confirmation after saving.<br>FIXED: Infinite scroll window title update.<br>FIXED: Various CSS improvements.</p><p>CHANGED: Builder does not wrap text element content with paragraph anymore.<br>CHANGED: Login style setting moved to Header - Account.<br>CHANGED: Register Flatsome with a purchase code.</p><p>DEV: Hook priority flatsome_add_icons_css changed from 10 - 150.<br>DEV: Added new flatsome_product_attribute_term_fields action.<br>DEV: Added new flatsome_new_flash_html filter.<br>DEV: Added new flatsome_swatch_html filter.<br>DEV: Added new flatsome_swatch_image_size filter.<br>DEV: Added new flatsome_swatches_cache_time filter.<br>DEV: Removed \'Inc\' in namespaces.</p><p>Note: Minimum required WooCommerce version 4.0.0.</p>\";}i:9;O:8:\"stdClass\":7:{s:2:\"id\";i:82050;s:9:\"timestamp\";i:1617135455;s:4:\"date\";s:12:\"Mar 30, 2021\";s:7:\"version\";s:6:\"3.13.3\";s:11:\"versionType\";s:5:\"patch\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:13;s:5:\"patch\";i:3;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:655:\"<p>--- 3.13.3 ---<br>FIXED: ContactForm7 progress spinner.<br>FIXED: Team Members: Displayed follow icons by default.<br>FIXED: Page Header: Background color for featured and normal style.<br>FIXED: Live search not yielding results for post/pages if its option and WC both are deactivated.<br>FIXED: Slider responsive margin.<br>FIXED: Builder: PHP 8 error in some cases.<br>FIXED: Builder: PHP warning \'Trying to get property \'post_type\' of non-object\' due WC on boarding task.</p><p>ENHANCEMENT: Author bio can now contain HTML.<br>ENHANCEMENT: Improved browser back button cache support.</p><p>DEV: Added new flatsome_author_bio_avatar_size filter.</p>\";}i:10;O:8:\"stdClass\":7:{s:2:\"id\";i:80835;s:9:\"timestamp\";i:1614262400;s:4:\"date\";s:12:\"Feb 25, 2021\";s:7:\"version\";s:6:\"3.13.2\";s:11:\"versionType\";s:5:\"patch\";s:17:\"versionComponents\";O:8:\"stdClass\":5:{s:5:\"major\";i:3;s:5:\"minor\";i:13;s:5:\"patch\";i:2;s:10:\"preRelease\";b:0;s:5:\"build\";b:0;}s:7:\"content\";s:1759:\"<p>--- 3.13.2 ---<br>NEW: Option to disable sale badge in catalog mode.<br>NEW: Slovenian translation added.</p><p>FIXED: Builder: Post multi select sorting.<br>FIXED: Builder: Reveal options on custom post Ids clearance.<br>FIXED: Builder: Gutenberg HTML blocks now show up as WP content blocks.<br>FIXED: Builder: Image placeholder position when added in mobile/tablet mode.<br>FIXED: Plugin integrated breadcrumbs did not show when WooCommerce not active.<br>FIXED: Portfolio filter stayed visible despite visibility option selection.<br>FIXED: Share links on shop and blog archive pages.<br>FIXED: Text box element parent styling issues.<br>FIXED: Wishlist whatsapp share (mobile).<br>FIXED: Cross-sells column amount filtering.<br>FIXED: Sticky header on tablet/mobile when admin bar is hidden.<br>FIXED: Google map not rendering sometimes on FF &amp; Safari.<br>FIXED: Slider not properly shown on custom dropdowns.<br>FIXED: Some menu item options did not save in some cases.<br>FIXED: Corrected WooCommerce address translation string.<br>FIXED: WP-CLI profiler outputted HTML in some cases.<br>FIXED: Divider left alignment in image box.<br>FIXED: Builder: PHP error on PHP 7.0.x.<br>FIXED: Various CSS improvements.<br>FIXED: Various PHP notices.</p><p>ENHANCEMENT: Follow element now shows global follow links if non is individually set by default.<br>ENHANCEMENT: Equal image heights setting now also affects upsells and related products.<br>ENHANCEMENT: Improved Flatsome Studio loading performance.<br>ENHANCEMENT: Improved support for decimal product quantities.<br>ENHANCEMENT: Improved WPML configuration.</p><p>DEV: Added new flatsome_header_account_username filter.<br>DEV: Added new flatsome_sale_bubble_percentage_cache_enabled filter.</p>\";}}}}s:9:\"no_update\";a:1:{s:15:\"twentytwentytwo\";a:6:{s:5:\"theme\";s:15:\"twentytwentytwo\";s:11:\"new_version\";s:3:\"1.1\";s:3:\"url\";s:45:\"https://wordpress.org/themes/twentytwentytwo/\";s:7:\"package\";s:61:\"https://downloads.wordpress.org/theme/twentytwentytwo.1.1.zip\";s:8:\"requires\";s:3:\"5.9\";s:12:\"requires_php\";s:3:\"5.6\";}}s:12:\"translations\";a:0:{}}','no'),(36317,'_site_transient_update_plugins','O:8:\"stdClass\":5:{s:12:\"last_checked\";i:1649510898;s:8:\"response\";a:5:{s:30:\"advanced-custom-fields/acf.php\";O:8:\"stdClass\":12:{s:2:\"id\";s:36:\"w.org/plugins/advanced