INSERT INTO `wp_posts` VALUES (2,1,'2019-04-30 10:56:07','2019-04-30 10:56:07','<h3><span style=\"font-size: 150%;\">Website đang trong quá trình xây dựng, bạn vui lòng quay lại sau</span></h3>\r\n[caption id=\"attachment_159\" align=\"aligncenter\" width=\"1300\"]<img class=\"wp-image-159 size-full\" src=\"http://myhome.muathemewordpress.net/wp-content/uploads/2019/05/58020505-abstract-blue-vector-runner-running-man-vector-isolated-illustration-sport-athlete-run-decathlon.jpg\" alt=\"\" width=\"1300\" height=\"1300\" /> Abstract blue vector runner. Running man, vector isolated illustration. Sport, athlete, run, decathlon[/caption]','Trang Mẫu','','publish','closed','open','','trang-mau','','','2019-05-11 03:50:57','2019-05-11 03:50:57','',0,'http://evadep.local/?page_id=2',0,'page','',0),(128,1,'2019-05-01 10:20:16','2019-05-01 10:20:16','<!-- wp:paragraph -->\n<p> Dung dịch xịt lợi khuẩn dạng bào tử Tri Fresh với thành phần tự nhiên, an toàn với sức khỏe khi sử dụng tác động lên búi trĩ sẽ giúp bạn</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hết đau rát, chảy máu búi trĩ chỉ sau 7- 10 ngày sử dụng</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Bào tử lợi khuẩn có trong Tri Fresh sẽ tiêu diệt vi khuẩn ở búi trĩ  trong hậu môn giúp bạn đi vệ sinh dễ dàng, không ra máu.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Hết viêm nhiễm búi trĩ, làm giảm mùi hôi hậu môn nhờ thành phần muối NaCl.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Tri Fresh triệt tiêu búi trĩ nhanh chóng, làm búi trĩ co lên tự nhiên và hệ tiêu hóa được phục hồi.</p>\n<!-- /wp:paragraph -->','Block tái sử dụng chưa có tên','','publish','closed','closed','','block-tai-su-dung-chua-co-ten','','','2019-05-01 10:20:16','2019-05-01 10:20:16','',0,'http://myhome.muathemewordpress.net/block-tai-su-dung-chua-co-ten.html',0,'wp_block','',0),(135,1,'2019-05-01 10:38:25','2019-05-01 10:38:25','<iframe width=\"1020\" height=\"574\" src=\"https://www.youtube.com/embe