, thuê N/Căn DT: 4,5m x 36m, nở hậu 6m, có khoảng sân 8m ( không gian mở có mái hiên kéo di động ),\r\n\r\n+ nằm ngay vị trí tốt , quán mình đầu tư chất lượng , phía sau có 2 toilet và 3 phòng máy lạnh cho thuê tháng ( hiện đang có người thuê ) , có bếp và máy giặt đầy đủ\r\n\r\n+ Nội thất bên trong quán cafe thì khỏi chê , phía ngoài có 10 bộ bàn và 30 ghế xếp , tivi mà hình 65 inch chiếu đá banh , dàn phun sương mát lạnh , hệ thống camera đầy đủ ,quán có máy pha và máy xay cafe sạch khách rất thích , máy tính tiền phần mềm sẵn hết , các công thức mình truyền lại hết luôn , ban đêm có thể bán thêm đồ ăn vì quán có bán bia và đặt biệt shisha rất ngon ...\r\n\r\n+ Nhân viên được đào tạo hết rồi , vào là hoạt động tiếp Ko cần đầu tư gì nữa hết , có vỉa hè rộng để xe thoải mái Hiện tại quán đã hoạt động hơn 3 tháng , và đã có lượng khách cố định , trước khi mở quán mình và bạn mình đã đầu tư vào 2 khoá học barista và nước uống Ko cồn, nên công thức nước quán mình rất ngon ,\r\n\r\n+ Giờ bạn hợp tác quản lý của mình bận việc nên Ko làm đuọc nữa , mình thì buổi tối phải xem 2 quán bar nên Ko có thời gian để làm nữa , giờ mình muốn sang lại giá yêu thương cho bạn nào đam mê\r\n\r\n+ giá sang 210.000 .000 ( bao gồm 140trieu cọc ) Ko thương lượng vì giá này quá rẻ so với tiền mình đã đầu tư .chủ nhà cực kỳ dễ thương, hoặc giá sang quán : 70 tr ( ko bao gồm cọc )\r\n\r\n+ Bạn nào muốn thì gọi mình để đến xem quán hoặc có thể ghé xem trước , nhưng xin đừng hỏi gì nhân viên vì mình Ko muốn nhân viên buồn .\r\n\r\ntel : 0984924552 Cầm hoặc Kun 0909385850\r\n\r\nXIN CẢM ƠN ĐÃ XEM TIN .','SANG QUÁN CAFE - BEER - VỈA HÈ + VIEW SÔNG ĐẸP, MT 162 Bến Văn Đồn,F.6, Quận 4','','publish','open','closed','','sang-quan-cafe-beer-via-he-view-song-dep-mt-162-ben-van-donf-6-quan-4','','','2020-11-14 15:35:30','2020-11-14 08:35:30','',0,'https://sangnhuongcafe.vn/?post_type=product&#038;p=1486',0,'product','',0),(1487,1,'2020-11-14 08:04:05','2020-11-14 01:04:05','','125125470_443518009968874_